USE `U5G_ACS_BO`;


SET @openidCustomPageLayoutDesc = 'OPENID Custom Form Page (OP)';
SET @opoidCustomFormPageType = 'OPOPID_CUSTOM_PAGE';

SET @idOpoCustomFormPage = (SELECT id
			FROM `CustomPageLayout`
			WHERE `pageType` = @opoidCustomFormPageType
			AND DESCRIPTION = @openidCustomPageLayoutDesc);

UPDATE `CustomComponent`
SET `value` = '
	<style>
		@font-face {
			font-family: "Chevin Pro Light";
			src: url(data:application/x-font-woff;charset=utf-8;base64,);
			font-weight: light;
			font-style: normal;
		}

			@font-face {
			font-family: "Chevin Pro DemiBold";
			src: url(data:application/x-font-woff;charset=utf-8;base64,);
			font-weight: Bold;
			font-style: normal;
		}

		@font-face {
			font-family: "Chevin Pro Medium";
			src: url(data:application/x-font-woff;charset=utf-8;base64,);
			font-weight: normal;
			font-style: normal;
		}
	</style>
	<style>
		div#optGblPage {
			width: 100%;
			font-family: "Chevin Pro Light";
			font-size:14px;
		}
		#optGblPage .warn {
			background-color: #3399FF;
		}
		#helpButton button {
			font: 300 16px/20px "Chevin Pro Light",sans-serif;
			display:inline-block;
			white-space: nowrap;
			text-align: center;
			height: 40px;
			background: #fff;
			color: #323232;
			border: 1px solid rgba(0,0,0,.25);
			min-width: 15rem;
			border-radius: 20px;
			font-size: 16px;
			padding-left: 0px !important;
		}
		#cancelButton button {
			font: 300 16px/20px "Chevin Pro Light",sans-serif;
			display:inline-block;
			white-space: nowrap;
			text-align: center;
			height: 40px;
			background: #fff;
			color: #323232;
			border: 1px solid rgba(0,0,0,.25);
			min-width: 15rem;
			border-radius: 20px;
			font-size: 16px;
			padding-left: 0px !important;
		}
		#validateButton {
			display:inline-block;
			padding-top:10px;
			margin-left:1em;
			vertical-align:4px;
		}
		#validateButton button {
			font-family: "Chevin Pro Light";
			font-size:16px;
			border-radius: 20px;
			color: #FFFFFF;
			background:#ff6a10;
			padding: 10px 20px 10px 20px;
			border: solid #e0e0e0 1px;
			text-decoration: none;
			min-width:150px;
		}
		#validateButton button:disabled {
			font-family: "Chevin Pro Light";
			font-size:16px;
			border-radius: 20px;
			color: #969696;
			background:#ffffff;
			border-color: #dcdcdc;
			padding: 10px 20px 10px 20px;
			border: solid #e0e0e0 1px;
			text-decoration: none;
			min-width:150px;
		}
		#validateButton > button > span {
			width:100%;
		}
		#validateButton > button > span.fa-check-square {
			display:none;
		}
		#validateButton button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}
		#cancelButton button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}
		#helpButton button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}
		#i18n > button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}

		#cancelButton button:hover:enabled {
			border-color: rgba(255,106,16,.75);
		}
		#cancelButton button:active {
			background-image: linear-gradient(rgba(0,0,0,.05),rgba(0,0,0,.05));
			border-color: rgba(0,0,0,.25) rgba(0,0,0,.2) rgba(0,0,0,.15);
			box-shadow: none;
			outline: 0px;
		}
		#cancelButton button custom-text {
			vertical-align:8px;
		}
		#helpButton button:hover {
			border-color: rgba(255,106,16,.75);
		}
		#helpButton button:active {
			background-image: linear-gradient(rgba(0,0,0,.05),rgba(0,0,0,.05));
			border-color: rgba(0,0,0,.25) rgba(0,0,0,.2) rgba(0,0,0,.15);
			box-shadow: none;
			outline: 0px;
		}
		#helpButton button custom-text {
			vertical-align:8px;
		}
		div#footer #helpButton button span:before {
			content:'''';
		}
		div #footer #cancelButton button span:before {
			content:'''';
		}
		div#footer #helpButton button span.fa {
			background-image:url(data:image/png;base64,);
			width:24px;
			height:26px;
			background-position-y: -1px;
			background-position-x: -2px;
			background-size: 115%;
			display:inline-block;
		}
		#helpCloseButton button {
			padding-left: 0px !important;
		}
		#helpCloseButton button span.fa {
			background-image:url(data:image/png;base64,);
			width:24px;
			height:26px;
			background-position-x: -2px;
			background-size: 115%;
			display:inline-block;
		}
		#helpCloseButton button span + span {
			margin-top: 1px;
		}
		div#footer #cancelButton button span.fa {
			background-image:url(data:image/png;base64,);
			width:24px;
			height:26px;
			background-position-y:1px;
			background-position-x: -2px;
			background-size:contain;
			display:inline-block;
			margin-right: 3px;
		}
		div#footer {
			padding-top: 12px;padding-bottom:12px;
			width:100%;
			background-color:#F0F0F0;
			text-align:center;
			margin-top: 15px;
			margin-bottom : 15px;
			clear:both;
		}
		#i18n-container {
			width:100%;
			clear:both;
		}
		#i18n-inner {
			display: block;
			margin-left: auto;
			margin-right: auto;
			clear:both;
		}
		#i18n > button {
			background: transparent;
			color: #557a8e;
			border: none;
			box-shadow: none;
		}
		#i18n > button.active {
			background: #06446c !important;
			color:#FFFFFF!important;
			border-radius: 5px !important;
		}
		.paragraph{
			text-align: left;
			margin-top: -2px;
			margin-bottom : 20px;
		}
		.leftColumn {
			width:40%;
			display:block;
			float:left;
		}
		.rightColumn {
			width:60%;
			margin-left:40%;
			display:block;
			text-align:left;
			padding:20px 10px;
		}
		.contentRow {
			width:100%;
			padding:1em;
			padding:0px;
			padding-top:1em;
			clear:both;
		}
		side-menu div.text-center {
			text-align:left;
		}
		div.side-menu div.menu-title::before {
			display:inline;
		}
		div.side-menu div.menu-title::after {
			display:inline;
		}
		div.side-menu div.menu-title {
			text-align:center;
			font-size: 18px;
		}
		div.side-menu div.menu-elements {
			margin-top:5px;
		}
		#otp-form {
			display:inline-block;
			padding-top:12px;
		}
		#otp-form input {
			box-sizing:content-box;
			padding: 5px 10px 3px;
			background-color: #fff;
			border: 1px solid rgba(0,0,0,.2);
			border-radius: 2px;
			box-shadow: inset 1px 1px 0 0 rgba(0,0,0,.1);
			font: 300 18px "Chevin Pro Light",sans-serif;
			font-size: 1.8rem;
			line-height: 25px;
			min-height: 35px;
		}
		#otp-form input:disabled {
			color: #bebebe!important;
			background-color: #dcdcdc!important;
			border-color: rgba(0,0,0,.05)!important;
			box-shadow: none!important;
		}
		#otp-form input:focus {
			border-color:#FF6A10 !important;
			outline-color: #FF6A10;
		}
		div#otp-fields-container {
			width:100%;
			text-align:left;
			margin-top:10px;
			margin-bottom:10px;
		}
		div#otp-fields {
			display:inline-block;
		}
		div#otp-form div.tooltips {
			background: #545454;
		}
		div#otp-form div.tooltips span {
			background: #545454;
		}
		div#otp-form div.tooltips span:after {
			border-top: 8px solid #545454;
		}
		message-banner {
			display: block;
			width: 100%;
			position: relative;
		}


		#pageHeader {
			width: 100%;
			height: 95px;
			border-bottom: 1px solid #dcdcdc;
		}
		#pageHeaderLeft {
			width: 20%;
			height: 100%;
			display: inline-flex;
			float: left;
		}
		#pageHeaderRight {
			width: 20%;
			height: 100%;
			display: inline-flex;
		}
		#pageHeaderCenter {
			width: 60%;
			float: left;
			text-align: center;
			line-height: 70px;
			padding-top: 16px;
		}
		div#networkLogoDiv {
			display: inline-block;
			width: 100%;
			text-align: right;
			align-self: center;
			padding-right: 16px;
		}
		div#issuerLogoDiv {
			display: inline-block;
			width: 100%;
			text-align: left;
			align-self: center;
			padding-left: 16px;
		}
		#issuerLogo {
			max-height: 65px;
		}
		#networkLogo {
			max-height: 65px;
		}

		@media (max-width: 1200px){
			#main-container{max-width: 1200px}
		}

		@media (max-width: 870px) {
			#main-container{max-width: 870px; overflow: hidden;}
			div.side-menu div.menu-title { padding-left:0px; }
			side-menu div.text-center {text-align:center;}
		}
		@media (max-width: 680px) {
			.leftColumn {width: 50%}
		}
		@media (max-width: 601px) {
			#main-container{max-width: 600px; overflow: hidden;}
			#headingTxt {font-size: 14px; display: table;}
			#pageHeaderCenter{font-size: 20px;}
			message-banner #spinner-row{height: 10px;}
			.paragraph{text-align: center;}
			.contentRow {display: grid;}
			.rightColumn {width: 100%; padding: 10px 10px; font-size: 12px; margin-left: 0px; text-align: center;}
			.leftColumn {font-size: 12px; width:100%;}
			div#footer {margin-top: 0px; margin-bottom: 0px;}
			#validateButton {padding-top: 0px;}
			#validateButton button {font-size: 14px; padding: 5px;10px;5px;10px}
			.contentRow {display: grid; padding-top: 0px}
			#pageHeader { height: 85px; }
			#issuerLogo { max-height: 40px; }
			#networkLogo { max-height: 40px; }
			#pageHeaderLeft {width: 25%; padding-left: 5px; }
			#pageHeaderRight{ width: 25%; float: right;text-align: right; padding-right: 5px}
			#pageHeaderCenter {width: 50%;}
			h1 {font-size: 26px;}
		}

		@media (max-width: 501px) {
			#main-container{max-width: 500px; overflow: hidden;}
			#headingTxt {font-size: 12px; display: table;}
			#pageHeaderCenter{font-size: 20px;}
			message-banner #spinner-row{height: 10px;}
			.paragraph{text-align: center;}
			.contentRow {display: grid;}
			.rightColumn {width: 100%; padding: 10px 10px; font-size: 12px;margin-left: 0px; text-align: center;}
			.leftColumn {font-size: 12px;width:100%;}
			div#footer {margin-top: 0px; margin-bottom: 0px;}
			#validateButton {padding-top: 0px;}
			#pageHeaderRight{ padding-right: 16px}
			#validateButton button {font-size: 16px; padding: 5px;10px;5px;10px}
		}


		@media (max-width: 430px) {
			#main-container{max-width: 430px; overflow: hidden;}
			h1 {font-size: 20px;}
			#pageHeaderLeft {width: 30%; padding-left: 0px; }
			#pageHeaderRight{ width: 30%; float: right;text-align: right;}
			#pageHeaderCenter {width: 40%;font-size: 20px;padding-top: 11px}
			#pageHeader { height: 70px; }
			#issuerLogo { max-height: 40px; }
			#networkLogo { max-height: 40px; }
		}


		 @media (max-width: 391px) {
			#main-container{max-width: 390px; overflow: hidden;}
			#headingTxt {font-size: 12px; display: table;}

			.h1 {font-size: 18px;}
			message-banner #spinner-row{height: 10px;}

			.paragraph{text-align: center;}
			.contentRow {display: grid; padding-top: 0px}
			.rightColumn {width: 100%; padding: 10px 10px; font-size: 12px;margin-left: 0px; text-align: center;}
			.leftColumn {font-size: 12px;width:100%;}
			div#footer {margin-top: 0px; margin-bottom: 0px;}
			div.side-menu div.menu-title{padding-left: 0px;}
			side-menu div.text-center {text-align:center;}
			h1 {font-size: 20px;}
			#validateButton button {font-size: 14px; padding: 5px;10px;5px;10px}

			#pageHeaderLeft {width: 30%; padding-left: 5px; }
			#pageHeaderRight{ width: 30%; float: right;text-align: right; padding-right: 5px}
			#pageHeaderCenter {width: 40%;font-size: 20px;padding-top: 0px}
		}

		 @media (max-width: 251px) {
			#main-container{max-width: 250px; overflow: hidden;}
			body {font-size: 8px;}
			.btn {font-size: 8px;}
			#centeredTitle {margin-top: 3px;}
			.side-menu .text-left, .side-menu .text-right {padding-right: 0px;padding-left: 3px;}
			div#leftMenuLayout {padding-left: 0px;padding-right: 0px; padding-bottom: 3px;}
			#rightContainer {width: 100%;}
			div#centerPieceLayout {min-height: 50px; padding-left: 10px; padding-right: 10px;}
			#switchId {padding-right: 0px;}
			#switchId button {min-width: 16rem;}
			#bottomMenu {width: 100%;}
			#i18n-container{padding-bottom: 0px;}
			.noLeftRightPadding {padding-left: 10px; font-size: 11px;}
			.btn {font-size: 11px;}
			.paragraph{text-align: center;font-size: 11px; margin-top: 3px;}
			.rightColumn {padding:0px;}
			.leftColumn {padding:0px;}
			div#footer {padding-top:0px; padding-bottom:0px; height:100%; margin-top: 0px; margin-bottom : 0px;}
			custom-component {width: 100%;}
			side-menu div.text-center {text-align:center;}
			h1 {font-size: 16px;}
			div#message-controls { margin-top: 0px; }
			#headingTxt {font-size: 12px; display: table;}
			message-banner #spinner-row{height: 10px;}
			div.side-menu div.menu-title{padding-left: 0px;}
			#validateButton {margin-left: 0px; margin-bottom: 5px;}
			#validateButton button {font-size: 14px; padding: 5px;10px;5px;10px;}
			#pageHeader { height: 60px; }
			#pageHeaderLeft {width: 30%; }
			#pageHeaderRight{ width: 30%; }
			#pageHeaderCenter {width: 40%;font-size: 14px;padding-top: 0px}
			#issuerLogo { max-height: 30px; }
			#networkLogo { max-height: 20px; }
			div#issuerLogoDiv {padding-left: 0px;}
			div#networkLogoDiv {padding-left: 0px;}
		}


	</style>

	<div id="optGblPage">
		<div id="pageHeader" ng-style="style" class="ng-scope">
			<div id="pageHeaderLeft" ng-style="style" class="ng-scope">
				<div id="issuerLogoDiv">
					<custom-image alt-key="''network_means_pageType_1_IMAGE_ALT''" image-key="''network_means_pageType_1_IMAGE_DATA''" id="issuerLogo" straight-mode="false"></custom-image>
				</div>
			</div>
				<div id="pageHeaderCenter" ng-style="style" class="ng-scope">
					<h1><custom-text custom-text-key="''network_means_CUSTOM_PAGE_1''"></custom-text></h1>
				</div>
				<div id="pageHeaderRight" ng-style="style" class="ng-scope" >
					<div id="networkLogoDiv">
						<custom-image alt-key="''network_means_pageType_2_IMAGE_ALT''"	image-key="''network_means_pageType_2_IMAGE_DATA''" id="networkLogo" straight-mode="false"></custom-image>
				</div>
			</div>
		</div>

		<message-banner close-button="''network_means_pageType_174''" back-button="''network_means_pageType_175''"></message-banner>
		<div id="i18n-container" class="text-center">
			<div id="i18n-inner">
				<i18n></i18n>
			</div>
		</div>
		<div class="contentRow">
			<div  x-ms-format-detection="none" class="leftColumn">
				<side-menu menu-title="''TRANSACTION_SUMMARY''"></side-menu>
			</div>
			<div class="rightColumn">
				<div class="paragraph">
					<custom-text custom-text-key="''network_means_CUSTOM_PAGE_2''" ></custom-text>
				</div>
				<op-open-id-form></op-open-id-form>
				<val-button val-label="''network_means_CUSTOM_PAGE_42''" id="validateButton" ></val-button>
			</div>
		</div>
		<div id="footer">
			<div ng-style="style" class="style">
				<cancel-button cn-label="''network_means_CUSTOM_PAGE_40''" id="cancelButton"></cancel-button>
				<help help-label="''network_means_CUSTOM_PAGE_41''" id="helpButton"></help>
			</div>
		</div>
	</div>' WHERE fk_id_layout = @idOpoCustomFormPage;

SET @helpPageLayoutDesc = 'Help Page (OP)';
SET @helpFormPageType = 'HELP_PAGE';

SET @helpFormPage = (SELECT id
			FROM `CustomPageLayout`
			WHERE `pageType` = @helpFormPageType
			AND DESCRIPTION = @helpPageLayoutDesc);

UPDATE `CustomComponent`
SET `value` = '
	<div id="help-page">
		<div id="help-heading" ng-style="style" class="ng-scope">
			<h1><custom-text custom-text-key="''network_means_HELP_PAGE_5''"></custom-text></h1>
		</div>
		<div id="help-contents">
			<p><custom-text custom-text-key="''network_means_HELP_PAGE_1''"></custom-text></p>
			<p> <custom-text custom-text-key="''network_means_HELP_PAGE_2''"></custom-text></p>
			<p> <custom-text custom-text-key="''network_means_HELP_PAGE_3''"></custom-text></p>
			<p><custom-text custom-text-key="''network_means_HELP_PAGE_4''"></custom-text></p>
		</div>
		<div class="row">
			<div class="col-xs-12" style="text-align:center">
				<div id="myhelpcontainer">
					<help-close-button id="helpCloseButton" help-label="toto"></help-close-button>
				</div>
			</div>
		</div>
	</div>

	<style>
		@font-face {
			font-family: "Chevin Pro Light";
			src: url(data:application/x-font-woff;charset=utf-8;base64,);
			font-weight: light;
			font-style: normal;
		}

		@font-face {
			font-family: "Chevin Pro DemiBold";
			src: url(data:application/x-font-woff;charset=utf-8;base64,);
			font-weight: Bold;
			font-style: normal;
		}

		@font-face {
			font-family: "Chevin Pro Medium";
			src: url(data:application/x-font-woff;charset=utf-8;base64,);
			font-weight: normal;
			font-style: normal;
		}
	</style>

	<style>
		#helpCloseButton button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}
		#helpButton button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}
		#i18n > button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}

		#help-contents {
			text-align:left;
			margin-top:20px;
			margin-bottom:20px;
		}
		#help-container #help-modal {
			overflow:hidden;
		}
		#helpCloseButton button {
			display: flex;
			align-items: center;
			width: 120px;
			margin-left: auto;
			margin-right: auto;
			justify-content: center;
		}
		#help-page {
			font-family:"Chevin Pro Light";
			font-size:14px;
			padding:14px;
			overflow:auto;
			text-align:left;
		}
		#help-heading {
			font-family:"Chevin Pro Light";
			font-size:22px;
			text-align: center;
		}
		@media screen and (max-width: 1200px) {
			h1 {font-size: 26px;}
			div#message-container {width:100%;box-shadow: none;-webkit-box-shadow:none;}
			#help-page {font-family:"Chevin Pro Light"; font-size:14px; padding: 0px;}
			body {line-height:0.92857143;}
			#help-contents {margin-top:0px; margin-bottom:0px;}
		}
		@media screen and (max-width: 601px) {
			h1 {font-size: 24px;}
			div#message-container {width:100%;box-shadow: none;-webkit-box-shadow:none;}
			#help-page {font-family:"Chevin Pro Light"; font-size:12px; padding: 0px;}
			body {line-height:0.92857143;}
			#help-contents {margin-top:0px; margin-bottom:0px;}
		}
		@media only screen and (max-width: 501px) {
			h1 {font-size: 20px;}
			div#message-container {width:100%;box-shadow: none; -webkit-box-shadow:none;}
			#help-page {font-family:"Chevin Pro Light";font-size:10px;}
			body {line-height:0.92857143;}
		}
		@media only screen and (max-width: 391px) {
			h1 {font-size: 18px;}
			#help-page {font-family:"Chevin Pro Light"; font-size:10px;}
			#helpCloseButton button {height: 30px;}
		}
		@media only screen and (max-width: 251px) {
			h1 {font-size: 16px;}
			#help-page {font-family:"Chevin Pro Light"; font-size:9px;}
			#help-contents{margin-top: 0px; margin-bottom:0px;}
			#helpCloseButton button {height: 30px;}
		}
	</style>' WHERE fk_id_layout = @helpFormPage;
